  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  NWR outlines Refuge accomplishments from May through August of 1959. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, mammals, insects, furbearers, and fish- is
  also covered. The Refuge development and maintenance section discusses physical
  developments. A progress report on field investigations and applied research is
  also provided. The public relations section of the report describes Refuge visitors,
  hunting, and fishing.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
